import React from "react";
import { Grid, Box, Typography, Button } from "@material-ui/core";

export default function Tasks() {
  return (
    <Grid container className="p-4" spacing={3}>
      <Grid item xs={12}>
        <Box className="box">
          <Box className="box badge-purple">
            <Box sx={{ display: "flex" }}>
              <Typography variant="subtitle1">Task</Typography>
              <Button>BUGS</Button>
              <Button>Doing</Button>
              <Button>Done</Button>
            </Box>
          </Box>
        </Box>
      </Grid>
    </Grid>
  );
}
